import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for the price filter inputs to appear
    await page.waitForSelector('#minPrice', { timeout: 5000 });
    await page.waitForSelector('#maxPrice', { timeout: 5000 });

    // Set min price to 50
    await page.fill('#minPrice', '');
    await page.type('#minPrice', '50');

    // Set max price to 200
    await page.fill('#maxPrice', '');
    await page.type('#maxPrice', '200');

    // Take screenshot after entering price range
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_price_range_filled.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_price_range_filled.png'));

    // Click the "Apply" button for price filter
    // Use text and class selector for robustness
    const applyButton = await page.waitForSelector('button.apply-filter', { timeout: 5000 });
    await applyButton.click();

    // Wait for the products grid/list to update
    // Wait for at least one product card to be visible
    await page.waitForSelector('.product-card, .product-card-list', { timeout: 5000 });

    // Take screenshot after filter applied
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_price_filter_applied.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_price_filter_applied.png'));

    // Extract product titles and prices displayed after filter
    const products = await page.$$eval('.product-card, .product-card-list', nodes =>
      nodes.map(node => {
        const title = node.querySelector('.product-title')?.innerText || '';
        const priceText = node.querySelector('.product-price')?.innerText || '';
        // Extract first price number from priceText
        const priceMatch = priceText.match(/\$([\d,.]+)/);
        const price = priceMatch ? parseFloat(priceMatch[1].replace(/,/g, '')) : null;
        return { title, price };
      })
    );

    // Filter out products where price is not within 50-200 (should all match, but double check)
    const filteredProducts = products.filter(p => p.price !== null && p.price >= 50 && p.price <= 200);

    return {
      success: true,
      action: "Applied price sort filter (min $50, max $200) and extracted filtered product data",
      extractedData: {
        filteredProducts
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
